import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './asset/AccessFolder/Login';
import ChatParent from './asset/ChatParentFolder/ChatParent';

function App(){

  return(
        <Router>
                <div>

                      <Route path="/login">
                       <Login />
                      </Route>
                      <Route path="/">
                        <ChatParent />
                      </Route>

                </div>
      </Router>
  );

}

export default App;
